import Title from './Component/Title'
import Emergency from './Emergency'

export default function HelpPage() {

  const [classes, setClasses] = useState("noClass")

  const changeClass = (t) => {setClasses(t)}

const swichEmergenctClass = () => {
switch (classes) {
  case "noClass":
    return <Emergency/>

    case "police":
    return <Emergency/>

    case "ambulance":
    return <Emergency/>

    case "Firefighters":
    return <Emergency/>


  default:
    break;
}

}





  return (



<div className='helpBox'>
  <div className='box1'>
   <button className='nav' onClick={swichEmergenctClass}>  
      <div className='one'></div>
      <div className='two'></div>
      <div className='three'></div>
   </button>
    </div>
    <div className='box2'>AAA</div>
    <div className='box3'>BBB</div>
        <button className='largeBtn'>SOS</button>
<div className='title'><Title  text = {"Help Me!"}/></div>
{swichEmergenctClass()}       
  </div>
  )
}
